   toppings: ["lettuce", "tomato", "mustard"]
  }
 var {meat,cheese}= sandwich;  
 meat="fish";
 cheese="butter";
 console.log(meat,cheese);

var Fun = ()=>{ 

   return <>
          <h1>{sandwich.meat}</h1>
          </>
} 


